  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for J. Clark
  Salyer National Wildlife Refuge outlines Refuge accomplishments during the 1987
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, croplands, grasslands, grazing, haying, fire management, pest
  control, water rights, WPA easements, and private lands. The wildlife section of
  the report discusses endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, fisheries resources, wildlife propagation,
  animal control, marking and bird banding, and disease control. The public uses of
  the Refuge described in this report include interpretive programs, hunting, fishing,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, and energy conservation.
  Cooperative programs and economic uses of the Refuge are provided at the end. Refuge
  brochures are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
